import { getHeroeById } from './bases/imp-exp';

const promesa = new Promise((resolve, reject) => {
  setTimeout(() => {
    // Tarea:
    // importar getHeroeById
    const heroe = getHeroeById(3);
    resolve(heroe);
  }, 2000);
});

promesa.then(heroe => {
  console.log('Then de la promesa', heroe);
});
